            <HeroInfo>
                <HeroHeader>Very important text!</HeroHeader>
                <HeroButtonText>
                    <a href = '/catalog'>
                        <HeroButton>Buy Gear</HeroButton>
                    </a>
                    <HeroText>Online & In Store</HeroText>
                </HeroButtonText>       
            </HeroInfo>
        </HeroContainer>

    );
}

